import React from 'react';
import {BrowserRouter,NavLink} from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Header from './Header';



function App() {
  return (
    // eslint-disable-next-line react/jsx-filename-extension
    <React.Fragment>
      <BrowserRouter>
        <Header />
      </BrowserRouter>
    </React.Fragment>
  );
}

export default App;
